  return (
    <TouchableOpacity>
      <View>
        <View style={{width: 70, height: 70, borderRadius: 50}}>
          <View />
        </View>
        <View>
            <View style={{flexDirection: "row"}}>
                <Text style={{color: "#FFF", fontWeight: "bold"}}>Username</Text>
                <Text style={{color: "#FFF"}}>9.30</Text>
            </View>
            <Text style={{color: "#AAA"}}>Lorem Ipsum is simply dummy text of the printing </Text>
        </View>
      </View>
    </TouchableOpacity>
  );
};

export default Chat;
